function createBehaviorBody(returnedType) { 
	var body = '  \n';

	switch(this.target()) {
	  case 'javascript':
      switch (returnedType) {
        case 'css':
        case 'html':
        case 'javascript':  
        case 'string':
          body = "  let result = '';\n  return result;\n";
          break;
        case 'array':
          body = "  let result = [];\n  return result;\n";
          break;
        case 'number':
          body = "  let result = 0;\n  return result;\n";
          break;
        case 'boolean':
          body = "  let result = false;\n  return result;\n";
          break;
        case 'object':
        case 'json':
          body = "  let result = {};\n  return result;\n";
          break;
        case 'date':
          body = "  let result = '';\n  return result;\n";
          break;
        case 'any':
          body = "  let result = '';\n  return result;\n";
          break;
        default:
          body = "  let result = {};\n  return result;\n";
          break;
      }
	    break;
	  default:
	    break;
	}

	return body;
}

