function createBehavior(name, params, body) { 
	var behavior = '',
	    funcName = '';

	switch(this.target()) {
	  case 'javascript':
	    if (body === '') {
	      body = '  \n';
	    }

	    if (name.indexOf('.') !== -1) {
	      funcName = name.split('.')[name.split('.').length - 1];
	    } else {
	      funcName = name;
	    }

	    behavior = "function " + funcName + "(" + params + ") { \n" + body + "}";
	    break;
    default:
      break;
	}

	return behavior;
}

