function createBehaviorParameters(model) { 
	var params = '',
	    i = 0,
	    length = 0;

	switch(this.target()) {
	  case 'javascript':
	   if (model && model.length) {
        length = model.length;
        for (i = 0; i < length; i++) {
          if (i === 0) {
            params = model[i].name;
          } else {
            params = params + ', ' + model[i].name;
          }
        }
      }
	    break;
    default:
      break;
	}

	return params;
}

